import React from "react";

import { NavLink } from "react-router-dom";

const Navigation = () => {
  return (
    <div>
      <div id='globalnav'>
        <div id='gnavLogo'>Lageplan</div>
        <NavLink to='/Kontakt'>Anmelden</NavLink>
        <NavLink to='/Kartenviewer'>Registrieren</NavLink>
        <NavLink to='/Kartenkatalog'>Gebäudeübersicht</NavLink>
        <NavLink to='/'>Lageplan</NavLink>
      </div>
    </div>
  );
};

export default Navigation;
